import React from 'react';
import Work from './Work';
import '../App.css';
import Navbar from '../components/widgets/Navbar';
import LandingPage from './landingPage';

function App() {
  return (
    <div className='MainPage'>
      <Navbar />
      <div className="content">
        <div>
          <LandingPage />
          <Work />
        </div>
      </div>

    </div>
  );
}

export default App;
